// Cookie Conent
window.cookieconsent.initialise({
    "palette": {
        "popup": {
            "background": "#1E88E5"
        },
        "button": {
            "background": "#ffffff",
            "text": "#454545"
        }
    },
    "position": "bottom-right",
    "content": {
        "message": "WeatherMX uses cookies to ensure you get the best experience on our website.",
        "dismiss": "Dismiss"
    }
});

$( document ).ready(function() {
    // Expand filter-control when on desktop
    $(window).on("load", function () {
        if ($(window).width() > 992) {
            $('.all-stations.all #filter-control-target').addClass('show');
        }
    });
    $(window).on("resize", function () {
        if ($(window).width() > 992) {
            $('.all-stations.all #filter-control-target').collapse('show');
        } else {
            $('.all-stations.all #filter-control-target').collapse('hide');
        }
    });
    
    // Add search text to URL
    $('.station-filter #inputSearch').each(function() {
        var value = $(this);
        value.data('old', value.val());
        value.bind("propertychange change click keyup input paste", function(event){
           if (value.data('old') != value.val()) {
            value.data('old', value.val());
            window.history.pushState("", "", "https://weathermx.bargent.co.uk/stations/all-stations?search=" + value.val());
          }
        });
    });
    
    // Stop enter submitting forms
    $('.station-filter').on('keyup keypress', function (e) {
        var keyCode = e.keyCode || e.which;
        if (keyCode === 13) {
            e.preventDefault();
            return false;
        }
    });
});

//TimeAgo Calculator
(function timeAgo(selector) {
    var templates = {
        prefix: "",
        suffix: " ago",
        seconds: "less than a minute",
        minute: "about a minute",
        minutes: "%d minutes",
        hour: "about an hour",
        hours: "about %d hours",
        day: "a day",
        days: "%d days",
        month: "about a month",
        months: "%d months",
        year: "about a year",
        years: "%d years"
    };
    var template = function(t, n) {
        return templates[t] && templates[t].replace(/%d/i, Math.abs(Math.round(n)));
    };
    var timer = function(time) {
        if (!time)
            return;
        time = time.replace(/\.\d+/, ""); // remove milliseconds
        time = time.replace(/-/, "/").replace(/-/, "/");
        time = time.replace(/T/, " ").replace(/Z/, " UTC");
        time = time.replace(/([\+\-]\d\d)\:?(\d\d)/, " $1$2"); // -04:00 -> -0400
        time = new Date(time * 1000 || time);

        var now = new Date();
        var seconds = ((now.getTime() - time) * .001) >> 0;
        var minutes = seconds / 60;
        var hours = minutes / 60;
        var days = hours / 24;
        var years = days / 365;

        return templates.prefix + (
            seconds < 45 && template('seconds', seconds) || seconds < 90 && template('minute', 1) || minutes < 45 && template('minutes', minutes) || minutes < 90 && template('hour', 1) || hours < 24 && template('hours', hours) || hours < 42 && template('day', 1) || days < 30 && template('days', days) || days < 45 && template('month', 1) || days < 365 && template('months', days / 30) || years < 1.5 && template('year', 1) || template('years', years)) + templates.suffix;
    };
    var elements = document.getElementsByClassName('time-ago');
    for (var i in elements) {
        var $this = elements[i];
        if (typeof $this === 'object') {
            $this.innerHTML = timer($this.getAttribute('title') || $this.getAttribute('datetime'));
        }
    }
    // update time every minute
    setTimeout(timeAgo, 1);
})();

//Thermometer Level
function thermometer(goalAmount, progressAmount, animate) {
    "use strict";
    var $thermo = $("#thermometer"),
        $progress = $(".progress", $thermo),
        $goal = $(".goal", $thermo),
        percentageAmount;

    goalAmount = goalAmount || parseFloat($goal.text()),
        progressAmount = progressAmount || parseFloat($progress.text()),
        percentageAmount = Math.min(Math.round(progressAmount / goalAmount * 1000) / 10, 100); //make sure we have 1 decimal point

    $goal.find(".amount").text();
    $progress.find(".amount").text();
    $progress.find(".amount").hide();

    if (animate !== false) {
        $progress.animate({
            "height": percentageAmount + "%"
        }, 1200, function() {
            $(this).find(".amount").fadeIn(200);
        });
    } else {
        $progress.css({
            "height": percentageAmount + "%"
        });
        $progress.find(".amount").fadeIn(200);
    }
}
thermometer()

