//Compass Rotate
function compass(compass_rotate) {
    $('.compass-dial').animate({
        borderSpacing: compass_rotate
    }, {
        step: function(now, fx) {
            $(this).css('-webkit-transform', 'rotate(' + now + 'deg)');
            $(this).css('-moz-transform', 'rotate(' + now + 'deg)');
            $(this).css('transform', 'rotate(' + now + 'deg)');
        },
        duration: 'slow',
    }, 'linear')

}
compass(compass_rotate);